import React, { useState } from 'react';
import styled, { createGlobalStyle } from 'styled-components';
import { motion, AnimatePresence } from 'framer-motion';
import TicketForm from './components/TicketForm';
import TicketResponse from './components/TicketResponse';
import Header from './components/Header';
import Background from './components/Background';

const GlobalStyle = createGlobalStyle`
  * {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
  }

  body {
    font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Roboto', sans-serif;
    background: #0a0a0a;
    color: #ffffff;
    min-height: 100vh;
    overflow-x: hidden;
    position: relative;
  }

  html {
    scroll-behavior: smooth;
  }

  ::-webkit-scrollbar {
    width: 8px;
  }

  ::-webkit-scrollbar-track {
    background: #1a1a1a;
  }

  ::-webkit-scrollbar-thumb {
    background: linear-gradient(45deg, #6366f1, #8b5cf6);
    border-radius: 4px;
  }

  ::-webkit-scrollbar-thumb:hover {
    background: linear-gradient(45deg, #4f46e5, #7c3aed);
  }
`;

const AnimatedBackground = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  z-index: -1;
  background: radial-gradient(circle at 20% 50%, rgba(120, 119, 198, 0.15) 0%, transparent 50%),
              radial-gradient(circle at 80% 20%, rgba(16, 185, 129, 0.15) 0%, transparent 50%),
              radial-gradient(circle at 40% 80%, rgba(139, 92, 246, 0.15) 0%, transparent 50%),
              radial-gradient(circle at 0% 100%, rgba(59, 130, 246, 0.1) 0%, transparent 50%),
              radial-gradient(circle at 100% 0%, rgba(236, 72, 153, 0.1) 0%, transparent 50%),
              linear-gradient(135deg, #0a0a0a 0%, #1a1a2e 50%, #16213e 100%);
  animation: backgroundShift 20s ease-in-out infinite alternate;
  transition: all 0.3s ease-out;
  
  &::before {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: radial-gradient(circle at 60% 30%, rgba(99, 102, 241, 0.1) 0%, transparent 40%),
                radial-gradient(circle at 30% 70%, rgba(16, 185, 129, 0.08) 0%, transparent 40%),
                radial-gradient(circle at 90% 90%, rgba(139, 92, 246, 0.12) 0%, transparent 40%);
    animation: backgroundShift2 15s ease-in-out infinite alternate-reverse;
    opacity: 0.8;
  }
  
  &::after {
    content: '';
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background: 
      radial-gradient(ellipse at 25% 25%, rgba(236, 72, 153, 0.05) 0%, transparent 50%),
      radial-gradient(ellipse at 75% 75%, rgba(59, 130, 246, 0.05) 0%, transparent 50%);
    animation: backgroundShift3 25s ease-in-out infinite;
    opacity: 0.6;
  }

  &:hover {
    background: radial-gradient(circle at 20% 50%, rgba(120, 119, 198, 0.25) 0%, transparent 50%),
                radial-gradient(circle at 80% 20%, rgba(16, 185, 129, 0.25) 0%, transparent 50%),
                radial-gradient(circle at 40% 80%, rgba(139, 92, 246, 0.25) 0%, transparent 50%),
                radial-gradient(circle at 0% 100%, rgba(59, 130, 246, 0.2) 0%, transparent 50%),
                radial-gradient(circle at 100% 0%, rgba(236, 72, 153, 0.2) 0%, transparent 50%),
                linear-gradient(135deg, #0a0a0a 0%, #1a1a2e 40%, #16213e 80%, #0f3460 100%);
    animation-duration: 8s;
    
    &::before {
      background: radial-gradient(circle at 60% 30%, rgba(99, 102, 241, 0.2) 0%, transparent 40%),
                  radial-gradient(circle at 30% 70%, rgba(16, 185, 129, 0.15) 0%, transparent 40%),
                  radial-gradient(circle at 90% 90%, rgba(139, 92, 246, 0.18) 0%, transparent 40%);
      animation-duration: 6s;
      opacity: 1;
    }
    
    &::after {
      background: 
        radial-gradient(ellipse at 25% 25%, rgba(236, 72, 153, 0.12) 0%, transparent 50%),
        radial-gradient(ellipse at 75% 75%, rgba(59, 130, 246, 0.12) 0%, transparent 50%),
        radial-gradient(ellipse at 50% 50%, rgba(16, 185, 129, 0.08) 0%, transparent 60%);
      animation-duration: 10s;
      opacity: 0.9;
    }
  }

  @keyframes backgroundShift {
    0% {
      background-position: 0% 0%, 100% 0%, 0% 100%, 100% 100%, 50% 50%;
      filter: hue-rotate(0deg) brightness(1);
    }
    25% {
      background-position: 100% 0%, 0% 100%, 100% 0%, 0% 0%, 0% 50%;
      filter: hue-rotate(15deg) brightness(1.1);
    }
    50% {
      background-position: 100% 100%, 0% 0%, 100% 100%, 0% 100%, 100% 0%;
      filter: hue-rotate(30deg) brightness(1.05);
    }
    75% {
      background-position: 0% 100%, 100% 100%, 0% 0%, 100% 0%, 50% 100%;
      filter: hue-rotate(45deg) brightness(1.15);
    }
    100% {
      background-position: 0% 0%, 100% 0%, 0% 100%, 100% 100%, 50% 50%;
      filter: hue-rotate(60deg) brightness(1);
    }
  }

  @keyframes backgroundShift2 {
    0% {
      transform: translate(0, 0) rotate(0deg) scale(1);
      opacity: 0.8;
    }
    33% {
      transform: translate(20px, -15px) rotate(5deg) scale(1.1);
      opacity: 0.6;
    }
    66% {
      transform: translate(-15px, 25px) rotate(-3deg) scale(0.9);
      opacity: 0.9;
    }
    100% {
      transform: translate(0, 0) rotate(0deg) scale(1);
      opacity: 0.8;
    }
  }

  @keyframes backgroundShift3 {
    0% {
      transform: translate(0, 0) scale(1) rotate(0deg);
      filter: hue-rotate(0deg);
    }
    50% {
      transform: translate(30px, 20px) scale(1.2) rotate(180deg);
      filter: hue-rotate(180deg);
    }
    100% {
      transform: translate(0, 0) scale(1) rotate(360deg);
      filter: hue-rotate(360deg);
    }
  }
`;

const AppContainer = styled.div`
  min-height: 100vh;
  position: relative;
  display: flex;
  flex-direction: column;
`;

const MainContent = styled.main`
  flex: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 2rem;
  position: relative;
  z-index: 2;
`;

const ContentWrapper = styled(motion.div)`
  width: 100%;
  max-width: 1200px;
  margin: 0 auto;
`;

function App() {
  const [ticketResponse, setTicketResponse] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleTicketSubmit = (response) => {
    setTicketResponse(response);
  };

  const handleNewTicket = () => {
    setTicketResponse(null);
  };

  const handleLoadingChange = (loading) => {
    setIsLoading(loading);
  };

  return (
    <>
      <GlobalStyle />
      <AppContainer>
        <Background />
        <Header />
        <MainContent>
          <ContentWrapper
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            transition={{ duration: 0.5 }}
          >
            <AnimatePresence mode="wait">
              {!ticketResponse ? (
                <motion.div
                  key="ticket-form"
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  exit={{ opacity: 0, y: -20 }}
                  transition={{ duration: 0.3 }}
                >
                  <TicketForm 
                    onSubmit={handleTicketSubmit}
                    onLoadingChange={handleLoadingChange}
                    isLoading={isLoading}
                  />
                </motion.div>
              ) : (
                <motion.div
                  key="ticket-response"
                  initial={{ opacity: 0, y: 20 }}
                  animate={{ opacity: 1, y: 0 }}
                  exit={{ opacity: 0, y: -20 }}
                  transition={{ duration: 0.3 }}
                >
                  <TicketResponse 
                    response={ticketResponse}
                    onNewTicket={handleNewTicket}
                  />
                </motion.div>
              )}
            </AnimatePresence>
          </ContentWrapper>
        </MainContent>
      </AppContainer>
    </>
  );
}

export default App;
